<template>
  <div class="upload-box">
    <div class="up-box" v-show="uploadBoxStatus">
      <label>
        <label class="white-header">
          آپلود فایل
        </label>
        <img class="normal-img" src="src/assets/images/upload.svg"/>
        <input
            type="file"
            :accept="getAccept"
            @input="addToUploadQueue"
            :multiple="!singleMode"
        />
      </label>
    </div>
    <div
        class="image-box"
        v-for="(item, index) in data"
        :key="index"
        :class="[
        { success: item.uploaded && item.uploadPercentage == 100 },
        { unSuccess: !item.uploaded && item.uploadPercentage == 100 }
      ]"
    >
      <div class="option">
        <div class="detail">
          {{ item.fileName }}
          <br />
          <small v-html="getFileSize(item.fileSize)"></small>
          <small v-html="item.fileType" class="ml-1"></small>
        </div>
        <div
            class="progress"
            v-show="item.uploadPercentage && item.uploadPercentage < 100"
            v-html="'uploading ' + item.uploadPercentage + '%'"
        ></div>
        <div class="delete">
          <span
              v-if="item.uploaded && item.uploadPercentage == 100"
              @click="deleteImage(item.id)"
              style="font-size: 14px;height: 15px; margin-bottom: 4px;"
          >✕</span
          >
          <span
              v-else-if="!item.uploaded && item.uploadPercentage == 100"
              @click="retryUpload(item.id)"
              style="font-size: 16px; height: 17px; margin-bottom: 4px;"
          >⟲</span
          >
          <span v-else>
            <svg
                xmlns="http://www.w3.org/2000/svg"
                xmlns:xlink="http://www.w3.org/1999/xlink"
                style="margin: auto; background: none; display: block; shape-rendering: auto;"
                width="20px"
                height="20px"
                viewBox="0 0 100 100"
                preserveAspectRatio="xMidYMid"
            >
              <circle
                  cx="50"
                  cy="50"
                  r="32"
                  stroke-width="9"
                  stroke="#ffffff"
                  stroke-dasharray="50.26548245743669 50.26548245743669"
                  fill="none"
                  stroke-linecap="round"
              >
                <animateTransform
                    attributeName="transform"
                    type="rotate"
                    repeatCount="indefinite"
                    dur="2.127659574468085s"
                    keyTimes="0;1"
                    values="0 50 50;360 50 50"
                ></animateTransform>
              </circle>
            </svg>
          </span>
        </div>
      </div>
      <div class="image">
        <img v-if="fileType == 'image'" :src="item.path" />
        <img
            v-else
            src="data:image/jpeg;base64,
"
        />
      </div>
    </div>
  </div>
</template>

<script>
import axios from "axios";
export default {
  props: {
    uploadUrl: {
      type: String,
      require: true
    },
    fileType: {
      type: String,
      require: false,
      default: () => {
        return "image";
      } //['image' , 'xls' , 'pdf']
    },
    uploadKey: {
      type: String,
      require: false,
      default: () => {
        return "uploadfile";
      }
    },
    files: {
      type: Array,
      require: true
    },
    params: {
      type: Object,
      require: false,
      default: () => {
        return {};
      }
    },
    maxFileSize: {
      type: [String, Number],
      require: false,
      default: () => {
        return 2;
      }
    },
    singleMode: {
      type: Boolean,
      default: () => {
        return false;
      }
    }
  },
  data() {
    return {
      data: [],
      uploadBoxStatus: true
    };
  },

  methods: {
    /* add images from out of component to component */
    setFiles(val) {
      for (let i of val) {
        this.data.push({
          id: i.id,
          path: i.path,
          file: i.path,
          uploadPercentage: 100,
          uploaded: true,
          fileName: "Uploaded Image",
          fileSize: null,
          fileType: this.fileType
        });
      }
    },
    /* calculate & get file size of selected file */
    getFileSize(bytes) {
      if (!bytes) return "";
      let sizes = ["Bytes", "KB", "MB", "GB", "TB"];
      if (bytes == 0) return "0 Byte";
      let i = parseInt(Math.floor(Math.log(bytes) / Math.log(1024)));
      return Math.round(bytes / Math.pow(1024, i), 2) + " " + sizes[i];
    },
    /* Check the upload success & push file to files list */
    returnFiles() {
      let data = this.data.filter(i => i.uploaded === true);
      this.$emit("update:files", data);
    },
    /* remove uploaded file from files list */
    deleteImage(id) {
      for (let i = 0; i < this.data.length; i++) {
        if (this.data[i].id === id) this.data.splice(i, 1);
      }
      this.returnFiles();
    },
    /* retry upload if upload failed */
    retryUpload(id) {
      for (let i = 0; i < this.data.length; i++) {
        if (this.data[i].id === id) {
          i.uploadPercentage = 0;
          i.uploaded = false;
        }
      }
    },
    /* add file to queue for uploading */
    addToUploadQueue(e) {
      try {
        let counter = 0;

        let id = this.data.length + 1;

        for (let i of e.target.files) {
          if (this.singleMode && counter === 1) throw "";

          let filePath = URL.createObjectURL(e.target.files[counter]);

          /* check accepted file type */
          if (
              this.fileType === "image" &&
              e.target.files[counter].type.split("/")[0] !== "image"
          ) {
            throw "امکان آپلود این فایل وجود ندارد";
          } else if (
              this.fileType !== "image" &&
              e.target.files[counter].type.split("/")[0] !== "application"
          ) {
            throw "امکان آپلود این فایل وجود ندارد";
          }

          /* check file size */
          if (typeof e.target.files[counter] != "undefined") {
            let maxSize = parseInt(Number(this.maxFileSize) * 1024 * 1024);
            let size = e.target.files[0].size;
            if (size > maxSize) {
              alert(
                  "حجم فایل نمی تواند بیشتر از " +
                  this.getFileSize(
                      parseInt(Number(this.maxFileSize) * 1024 * 1024)
                  ) +
                  " باشد"
              );
              throw "";
            }
          }
          /* push file to Queue for upload */
          this.data.push({
            id: id,
            path: filePath,
            file: e.target.files[counter],
            uploadPercentage: -1,
            uploaded: false,
            fileName: e.target.files[counter].name,
            fileSize: e.target.files[counter].size,
            fileType: e.target.files[counter].type.split("/")[1]
          });
          // this.uploadFile();

          counter++;
        }
      } catch (e) {
        console.log(e);
      }
    },
    /* upload  queue files */
    async uploadFile() {
      for (let i of this.data) {
        if (i.uploaded === false) {
          let formData = new FormData();

          for (let p of Object.keys(this.params)) {
            formData.append(p, this.params[p]);
          }

          formData.append(this.uploadKey, i.file);
          try {
            i.uploaded = "inProgress";
            let config = {
              headers: { "Content-Type": "multipart/form-data" },
              onUploadProgress: progressEvent => {
                i.uploadPercentage = Number(
                    Math.round((progressEvent.loaded * 100) / progressEvent.total)
                );
              }
            };
            let upload = await axios.post(
                this.uploadUrl,
                formData,
                config
            );
            i.id = upload.data.result.id_file;
            i.uploaded = true;
            i.file = null;

            this.$emit("afterUpload", upload.data.result);
          } catch (e) {
            i.uploaded = "fail";
            this.deleteImage(i.id);
          }
          this.returnFiles();
        }
      }
    }
  },
  computed: {
    /* get accept value by fileType */
    getAccept() {
      switch (this.fileType) {
        case "image":
          return "image/*";
          break;
        case "xls":
          return ".csv, application/vnd.openxmlformats-officedocument.spreadsheetml.sheet, application/vnd.ms-excel";
          break;
        case "pdf":
          return "application/pdf";
          break;
      }
    }
  },
  watch: {
    /* if singleMode is true disable uploadFile btn */
    data: function() {
      if (this.singleMode) this.uploadBoxStatus = this.data.length !== 1;
    }
  }
};
</script>

<style scoped lang="scss">
.white-header{
  color: #EEEEEE;
  font-size: 16px;
  margin-left: 0.5rem;
}
.upload-box {
  border: 1.5px dashed #15AB89;
  //width: auto !important;
  //height: auto;
  border-radius: 10px;
  display: flex;
  justify-content: flex-start;
  align-items: center;
  flex-flow: wrap;
  width: 100%;

  .up-box {
    width: 100%;

    label {
      backdrop-filter: blur(10px);
      border-radius: 10px;
      display: flex;
      justify-content: center;
      align-items: center;
      cursor: pointer;
      min-height: 5rem;
      input[type="file"] {
        display: none;
      }

      i,
      svg {
        color: rgba(111, 113, 123, 0.87);
        font-size: 40px;
        opacity: 0.3;
      }
    }
  }

  .image-box {
    background-color: rgba(111, 113, 123, 0.71);
    width: auto;
    height: auto;
    border-radius: 10px;
    margin: 10px;
    overflow: hidden;
    transition: 0.3s;
    position: relative;
    box-shadow: inset 0px 140px 300px -110px rgba(27, 27, 28, 0.75);

    .image {
      width: auto;
      height: 150px;
      margin: 0 auto;
      overflow: hidden;
      transition: 0.3s;
      position: relative;

      img {
        border-radius: 10px;
        width: auto;
        height: 100%;
        object-fit: cover;
      }
    }

    .option {
      z-index: 2;
      box-shadow: inset 0px 140px 300px -95px rgba(0, 0, 0, 0.75);
      background-color: transparent;
      position: absolute;
      right: 0;
      top: 0;
      width: 100%;
      height: 100%;
      transition: 0.3s;
      display: flex;
      justify-content: center;
      padding: 5px;

      .detail {
        overflow: hidden;
        color: #fff;
        width: 80%;
        white-space: nowrap;
        font-size: 11px;
        font-weight: 200;
        border-radius: 50px;
        padding: 0 10px;
        position: absolute;
        top: 5px;
        left: 5px;
        text-align: left;
        direction: ltr;

        small {
          color: rgba(255, 255, 255, 0.62);
        }
      }

      .progress {
        background-color: rgba(0, 0, 0, 0.66);
        color: #fff;
        font-size: 12px;
        border-radius: 50px;
        padding: 0 10px;
        position: absolute;
        bottom: 5px;
        left: 5px;
        height: 30px;
        display: flex;
        align-items: center;
        justify-content: center;
      }

      .delete {
        color: #fff;
        background-color: rgba(0, 0, 0, 0.66);
        position: absolute;
        border-radius: 50px;
        cursor: pointer;
        display: flex;
        justify-content: center;
        align-items: center;
        top: 5px;
        right: 5px;
        width: 30px;
        font-size: 12px;
        height: 30px;
        transition: 0.3s ease-in-out;

        &:hover {
          color: red;
        }
      }
    }

    &.success {
      .option {
        box-shadow: inset 0px 110px 300px -105px rgb(39, 174, 96);
      }
    }

    &.unSuccess {
      .option {
        box-shadow: inset 0px 140px 300px -105px rgba(244, 67, 54, 0.75);
      }
    }
  }
}

.normal-img {
  width: 50%;
  height: 4rem;
}
</style>
